Sportsman's Expo, September 23, Bayside Supper Club, W9231 County Highway G, Beaver Dam, WI just west of Madison Street at the south end of Beaver Dam Lake; 

4 - 8 pm; featuring new and used hunting, fishing and camping equipment + more.  Dealers welcome; Vendor tables available $15 each;  

Admission: $3 adults; 13 & Under FREE. Sportsman's Expo Raffle that night for a Smith and Wesson Semi-Automatic 9mm Pistol, Model SD9VE

